INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("ぺコリーヌ", 1, 8, 91002, 1, 37, 107501, 0, 40001, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 150);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("コッコロ", 1, 8, 91002, 2, 38, 107601, 0, 40001, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 150);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("キャル", 1, 8, 91002, 3, 39, 107801, 0, 40001, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 150);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("スズメ", 1, 8, 91002, 4, 40, 107701, 0, 40001, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 150);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("タマキ", 1, 8, 91002, 5, 41, 107901, 0, 40001, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 150);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("ぺコリーヌ", 2, 8, 91002, 6, 42, 107501, 0, 40001, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 150);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("コッコロ", 2, 8, 91002, 7, 43, 107601, 0, 40001, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 150);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("キャル", 2, 8, 91002, 8, 44, 107801, 0, 40001, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 150);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("スズメ", 2, 8, 91002, 9, 45, 107701, 0, 40001, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 150);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("タマキ", 2, 8, 91002, 10, 46, 107901, 0, 40001, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 150);
